{
	// Setup interrupts
	disable_A9_interrupts (); // disable interrupts in the A9 processor
	set_A9_IRQ_stack (); // initialize the stack pointer for IRQ mode
	config_GIC (); // configure the general interrupt controller
	config_KEYs (); // configure KEYs to generate interrupts
	config_TIMER ();
	enable_A9_interrupts (); // enable interrupts in the A9 processor
	
	// Setup VGA pixel buffer 
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	
	// Setup character buffer 
	volatile int* character_ctrl_ptr = (int*)0xFF203030;
	character_buffer_start  = *character_ctrl_ptr;
	
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the back buffer
	/* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	
	// Make sure that globals are reset
	x_position_bowser = RESOLUTION_X;
	x_pos_bg_1 =0; 
	x_pos_bg_2 = RESOLUTION_X; 
	
	//set random seed 
	time_t t;
  	srand((unsigned) time(&t));
	
	set_random_coin_pos(); 
	
	while (1) // wait for an interrupt
	{
		clear_screen();
		draw_score(); 
		draw_background(27, 340, background, x_pos_bg_1);
		draw_background(27,340, background, x_pos_bg_2);
		//erase_image(b_size, x_position_bowser+2, BOWSER_Y);
		check_coin_collision(); 
		draw_image(y_size, yoshi, YOSHI_X, y_pos_yoshi);
		draw_image(c_size, coin, x_pos_coin, y_pos_coin); 
		draw_image(b_size, bowser, x_position_bowser, BOWSER_Y);
		//wait and swap buffers
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
		pixel_buffer_start = *(pixel_ctrl_ptr + 1); // update pointer to memory where u draw the next image -> get from dma controller
	}
	
}

/* setup the KEY interrupts in the FPGA */
void config_KEYs()
{
	volatile int * KEY_ptr = (int *) 0xFF200050; // KEY base address
	*(KEY_ptr + 2) = 0xF; // enable interrupts for all four KEYs
}

// Set up timer interupts 
void config_TIMER (void)
{
	// ARM A9 Private Timer Address 
	// Load Speed
	volatile int* TIMER_ptr = (int*) 0xFFFEC600;
	*TIMER_ptr = background_speed;
	//start timer 
	volatile int* TIMER_ctrl = (int*) 0xFFFEC608; 
	*TIMER_ctrl = 0b111; // set mode = 1 (auto), enable = 1 
}
	
/* Below:
* 1. defines exception vectors for the A9 processor
* 2. provides code that sets the IRQ mode stack, and that dis/enables
* interrupts
* 3. provides code that initializes the generic interrupt controller
*/
void pushbutton_ISR (void);
void timer_ISR();
void config_interrupt (int, int);
// Define the IRQ exception handler
void __attribute__ ((interrupt)) __cs3_isr_irq (void)
{
	// Read the ICCIAR from the CPU Interface in the GIC
	int interrupt_ID = *((int *) 0xFFFEC10C);
	if (interrupt_ID == 73) // check if interrupt is from the KEYs
		pushbutton_ISR ();
	else if (interrupt_ID == 29) 
		timer_ISR(); 
	else
		while (1); // if unexpected, then stay here
	// Write to the End of Interrupt Register (ICCEOIR)
	*((int *) 0xFFFEC110) = interrupt_ID;
}

// Define the remaining exception handlers
void __attribute__ ((interrupt)) __cs3_reset (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_undef (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_swi (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_pabort (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_dabort (void)
{
	while(1);
}
void __attribute__ ((interrupt)) __cs3_isr_fiq (void)
{
	while(1);
}

/*
* Turn off interrupts in the ARM processor
*/
void disable_A9_interrupts(void)
{
	int status = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}

/*
* Initialize the banked stack pointer register for IRQ mode
*/
void set_A9_IRQ_stack(void)
{
	int stack, mode;
	stack = 0xFFFFFFFF - 7; // top of A9 onchip memory, aligned to 8 bytes
	/* change processor to IRQ mode with interrupts disabled */
	mode = 0b11010010;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
	/* set banked stack pointer */
	asm("mov sp, %[ps]" : : [ps] "r" (stack));
	/* go back to SVC mode before executing subroutine return! */
	mode = 0b11010011;
	asm("msr cpsr, %[ps]" : : [ps] "r" (mode));
}

/*
* Turn on interrupts in the ARM processor
*/
void enable_A9_interrupts(void)
{
	int status = 0b01010011;
	asm("msr cpsr, %[ps]" : : [ps]"r"(status));
}

/*
* Configure the Generic Interrupt Controller (GIC)
*/
void config_GIC(void)
{
	config_interrupt (73, 1); // configure the FPGA KEYs interrupt (73)
	config_interrupt(29, 1); // configure A9 private timer 
	// Set Interrupt Priority Mask Register (ICCPMR). Enable all priorities
	*((int *) 0xFFFEC104) = 0xFFFF;
	// Set the enable in the CPU Interface Control Register (ICCICR)
	*((int *) 0xFFFEC100) = 1;
	// Set the enable in the Distributor Control Register (ICDDCR)
	*((int *) 0xFFFED000) = 1;
}

/*
* Configure registers in the GIC for an individual Interrupt ID. We
* configure only the Interrupt Set Enable Registers (ICDISERn) and
* Interrupt Processor Target Registers (ICDIPTRn). The default (reset)
* values are used for other registers in the GIC
*/
void config_interrupt (int N, int CPU_target)
{
	int reg_offset, index, value, address;
	/* Configure the Interrupt Set-Enable Registers (ICDISERn).
	* reg_offset = (integer_div(N / 32) * 4; value = 1 << (N mod 32) */
	reg_offset = (N >> 3) & 0xFFFFFFFC;
	index = N & 0x1F;
	value = 0x1 << index;
	address = 0xFFFED100 + reg_offset;
	/* Using the address and value, set the appropriate bit */
	*(int *)address |= value;
	/* Configure the Interrupt Processor Targets Register (ICDIPTRn)
	* reg_offset = integer_div(N / 4) * 4; index = N mod 4 */
	reg_offset = (N & 0xFFFFFFFC);
	index = N & 0x3;
	address = 0xFFFED800 + reg_offset + index;
	/* Using the address and value, write to (only) the appropriate byte */
	*(char *)address = (char) CPU_target;
}

/********************************************************************
* Pushbutton - Interrupt Service Routine
*
* This routine checks which KEY has been pressed. It writes to HEX0
*******************************************************************/
void pushbutton_ISR( void )
{
	/* KEY base address */
	volatile int *KEY_ptr = (int *) 0xFF200050;
	/* HEX display base address */
	//volatile int *HEX3_HEX0_ptr = (int *) 0xFF200020;
	int press;
	//int HEX_bits;
	press = *(KEY_ptr + 3); // read the pushbutton interrupt register
	*(KEY_ptr + 3) = press; // Clear the interrupt
	if (press & 0x1) // KEY0
		yoshi_jump = -1;
	//*HEX3_HEX0_ptr = HEX_bits;
	return;
}

/********************************************************************
* Timer - Interrupt Service Routine
*
* This routine checks which KEY has been pressed. It writes to HEX0
*******************************************************************/
void timer_ISR()
{
	// Clear the interrupt 
	volatile int *timer_interupt = (int*) 0xFFFEC60C;
	*timer_interupt = *timer_interupt; 
	
	// Increment Jr.Bowsers position 
	if(x_position_bowser > -b_size) 
		x_position_bowser--; 
	else 
		x_position_bowser = BOWSER_START_X; 
	
	// Increment the background
	if(x_pos_bg_1 > -RESOLUTION_X)
		x_pos_bg_1--; 
	else 
		x_pos_bg_1 = RESOLUTION_X;
	
	
	if(x_pos_bg_2 > -RESOLUTION_X)
		x_pos_bg_2--; 
	else 
		x_pos_bg_2 = RESOLUTION_X;

	// Increment the coin
	if(x_pos_coin > -c_size)
		x_pos_coin--; 
	else 
		set_random_coin_pos();
	
	if(y_pos_yoshi > c_size-10 && yoshi_jump  == -1) 
		y_pos_yoshi += yoshi_jump; 
	else if (y_pos_yoshi == c_size-10 && yoshi_jump == -1) 
	{
		yoshi_jump = 1;
		y_pos_yoshi += yoshi_jump; 
	}
	else if (y_pos_yoshi < YOSHI_Y_START && yoshi_jump == 1) 
		y_pos_yoshi +=yoshi_jump;
		
}

// When s=0 the backbuffer and front buffer contents are swapped
void wait_for_vsync()
{
	volatile int *pixel_ctrl_ptr = (int*) 0xFF203020; // pixel controller
	register int status;

	*pixel_ctrl_ptr = 1; // request to sync with DMA controller makes S=1
	status = *(pixel_ctrl_ptr + 3); // get status register

	while ((status & 0x01) != 0) //check to see if s bit is equal to 0 -> DMA is done drawing
	{
		status = *(pixel_ctrl_ptr+3);
	}
	return;

}

// code clear_screen() and draw_line() subroutines
void clear_screen(){
	for(int x = 0; x <= 319; x++){
		for(int y = 0; y <= 239; y++){
			plot_pixel(x,y,0);
		}
	}
}

// Plot a single pixel to the buffer 
void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void draw_image(int size, short int image[size][size], int start_position_x, int start_position_y)
{
	int row; 
	int col;
	for(row = 0; row < size; row++)
	{
		for(col = 0; col < size; col++) 
		{
			plot_pixel(col+start_position_x, row+start_position_y, image[row][col]);
		}
	}
}

void erase_image(int size, int start_position_x, int start_position_y) 
{
	int row; 
	int col;
	for(row = 0; row < size; row++)
	{
		for(col = 0; col < size; col++) 
		{
			plot_pixel(col+start_position_x, row+start_position_y, BLACK);
		}
	}
	
}

void draw_background(int bg_height, int bg_width, short int background[bg_height][bg_width], int x_pos_bg)
{
	int row;
	int col;
	for(row = 0; row < 27; row++)
	{
		for (col = 0; col<340; col++)
		{
			plot_pixel (col+x_pos_bg, row+BG_Y, background[row][col]);
		}
	}
}

void set_random_coin_pos()
{
	y_pos_coin = (rand() % 126);
	x_pos_coin = (rand() % (450 - RESOLUTION_X + 1)) + RESOLUTION_X;

}

void check_coin_collision()
{
	if(x_pos_coin > YOSHI_X && x_pos_coin < y_size+YOSHI_X)
	{
	// Did yoshi hit it 
		if(y_pos_yoshi<y_pos_coin+c_size)
		{
			score++; 
			set_random_coin_pos();
		}
				

	}
}

void draw_character(int x, int y, char ascii)
{
	*(char *)(character_buffer_start + (y << 10) + (x << 1)) = ascii;	
}

void draw_score()
{
	draw_character(103, 0, (char)(score+'0')); 
	draw_character(102, 0, ':'); 
	draw_character(101, 0, 'S'); 
	draw_character(100,0, 'N'); 
	draw_character(99, 0, 'I'); 
	draw_character(98, 0, 'O'); 
	draw_character(97,0,'C'); 
}


